import React from "react";

function PersonList({ people, onEdit, onDelete }) {
  return (
    <div>
      <h2>Lista de Pessoas</h2>
      <ul>
        {people.map((person) => (
          <li key={person.id}>
            <p>{person.name}</p>
            <p>{person.email}</p>
            <p>{person.age} anos</p>
            <p>{person.date}</p>
            <button onClick={() => onEdit(person)}>Editar</button>
            <button onClick={() => onDelete(person.id)}>Excluir</button>
          </li>
        ))}
      </ul>
    </div>
  );
}

export default PersonList;
